import React from 'react';

const Pagination = () => {
    const pageCount = Math.ceil(device.totalCount / device.limit)
    const pages = [];

    for (let i = 0; i < pageCount; i++) {
        pages.push(i + 1)
    }

    return (
        <div>
            {pages}
        </div>
    );
};

export default Pagination;
